import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Name/>
      <College/>
      <Stream/>
      <>WantTOBe</>
    </div>
  );
}
  function Name(){
    return(
      <div>
        <h1>Hello Everyone my name is Md Afsar</h1>
      </div>
    )
  }
function College(){
    return(
      <div>
        <h2>I study at Aliah University</h2>
      </div>
    )
  }
function Stream(){
    return(
      <div>
        <h3>I pursuing b.tech in CSE</h3>
      </div>
    )
  }
function WantTOBe(){
    return(
      <div>
        <h4>Going to become a developer</h4>
      </div>
    )
  }
  function Thanks(){
    return(
      <div>
        <h4>Thanks for reading about me .</h4>
      </div>
    )
  }
export default App;
